import React from 'react'

class Header extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div className="header-wrapper">
        <div className="constrained-width">
          <img className="logo logo-sm" src="/images/logo.png" />
        </div>
      </div>
    )
  }
}

export default Header
